import React from "react";

export default function Card({ card, onCardClick }) {
    const handleCardClick = () => onCardClick(card);

    return (
        <div class="element">
              <img class="element__image"  
              src={card.link}
              alt={card.name} onClick={handleCardClick}/>
              <div class="element__content">
                <h2 class="element__title">{card.name}</h2>
                <div class="element__likes">
                  <button
                  class="element__like"
                  title="Лайк"
                  type="button"
                ></button>
                <span class="element__likes-quantity">{card.likes.length}</span>
                </div>
              </div>
              <button type="button" class="element__delete">Удалить</button>
        </div>
    )
}
